import React from 'react';
import PropsTile from './PropsTile'



const FaceRecognition = ({imageUrl, namesList, faceRec}) => {

    const Draw = namesList.map((object , i) => {
        return <PropsTile key={i} name={namesList[i].name}/>
    });
    (faceRec) =>{
        if(faceRec === false){
            return(
            <div className=' cf flex flex-wrap justify-center ma3'>

                <div className='br3 w-30 pa3 shadow-1'>
                   <img className='br3' src={imageUrl} alt='Your Image Should Appear Here' />


                </div>
                <div className=' flex flex-wrap w-30 pa3 '>
                    {Draw}
                </div>
            </div>
        )}
    };
}

export default FaceRecognition;
